import styled from "styled-components";

export const StyledHeader = styled.header`
  width: ${(props) => props.theme.pageWidth};
  margin: 0 auto;
  padding: 20px 55px;
  margin-bottom: 40px;
  display: flex;
  align-items: center;
`;
